                case ColorUI.GreenDark:
                    if (isSelected)
                    {
                        return GreenDarkSelected;
                    }
                    else
                    {
                        return GreenDark;
                    }
                case ColorUI.BlueDark:
                    if (isSelected)
                    {
                        return BlueDarkSelected;
                    }
                    else
                    {
                        return BlueDark;
                    }
                case ColorUI.Aqua:
                    if (isSelected)
                    {
                        return AquaSelected;
                    }
                    else
                    {
                        return Aqua;
                    }
                case ColorUI.Tan:
                    if (isSelected)
                    {
                        return TanSelected;
                    }
                    else
                    {
                        return Tan;
                    }
                case ColorUI.GreenDarkness:
                    if (isSelected)
                    {
                        return GreenDarknessSelected;
                    }
                    else
                    {
                        return GreenDarkness;
                    }
                case ColorUI.BlueViolet:
                    if (isSelected)
                    {
                        return BlueVioletSelected;
                    }
                    else
                    {
                        return BlueViolet;
                    }
                default:
                    if (isSelected)
                    {
                        return YellowSelected;
                    }
                    else
                    {
                        return Yellow;
                    }
            }
        }

        private string GetColor(DesignType type, ColorUI color, bool isChecked)
        {
            MethodInfo methodToInvoke = GetType().GetMethod("GetImage" + type.ToString(), BindingFlags.NonPublic | BindingFlags.Instance);

            object[] parametersInvoke = { color, isChecked };

            var returnStringColor = (string)methodToInvoke.Invoke(this, parametersInvoke);
            return returnStringColor;
        }
    }
